#the regex code used to do the initial sorting and searching of the text

import codecs
import re
from collections import Counter

with codecs.open('Alice_s_Adventures_in_Wonderland[ENG].txt','r',encoding='utf-8', errors='ignore') as f:
	letters = re.findall(r"[a-zA-Z]{,1}", f.read())
print("All letters in the text: ", letters)	#prints all letters that appear in the text in the file

with codecs.open('Alice_s_Adventures_in_Wonderland[ENG].txt','r',encoding='utf-8', errors='ignore') as f:
	letters = re.findall(r"[a-zA-Z]\'{,1}", f.read())
	letter_counts = Counter(letters)
print("Most frequently occurring letters in the text: ", letter_counts) #prints most frequently occurring letters

with codecs.open('Alice_s_Adventures_in_Wonderland[ENG].txt','r',encoding='utf-8', errors='ignore') as f:
	words = re.findall(r'\w+', f.read())
	word_counts = Counter(words)
print("Most frequently occurring words in the text: ", word_counts) #prints most frequently occurring words

with codecs.open('Alice_s_Adventures_in_Wonderland[ENG].txt','r',encoding='utf-8', errors='ignore') as f:
	vowels = re.findall(r"[aeiouAEIOU]\'{,1}", f.read())
	vowel_counts = Counter(vowels)
print("Most frequently occurring vowels in the text: ",vowel_counts)

with codecs.open('Alice_s_Adventures_in_Wonderland[ENG].txt','r',encoding='utf-8', errors='ignore') as f:
	consonants = re.findall(r"[^aeiouAEIOU]\'{,1}", f.read())
	consonant_counts = Counter(consonants)
print("Most frequently occurring consonants in the text: ", consonant_counts)


