#Binary Search

letters = ['The', 'big', 'sea']

def sortLetters():
    global letters
    letters.sort()

def binarySearch():
    global letters, found, letterSearch, lower_bound, middle_pos, upper_bound

    letterSearch = input("What letter are you looking for? ")
    lower_bound = 0
    upper_bound = len(letters)-1
    found = False
    while lower_bound <= upper_bound and not found:
        middle_pos = (lower_bound+upper_bound) // 2
        if letters[middle_pos] < letterSearch:
            lower_bound = middle_pos + 1
        elif letters[middle_pos] > letterSearch:
            upper_bound = middle_pos - 1
        else:
            found = True
    if found:
        print("The letter is at position", middle_pos)
    else:
        print("The letter was not in the list.")                           

def main():
        sortLetters()
        binarySearch()

if __name__ == "__main__":
    main()
	
